import React, { useState } from "react";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";
import Modal from "../components/ModalExportPdf"; // tu componente Modal

const ExportPDFButton = ({ data = [] }) => {
  const columns = [
    { key: "nombre", label: "Nombre" },
    { key: "apellido", label: "Apellido" },
    { key: "dni", label: "DNI" },
    { key: "estado_civil", label: "Estado Civil" },
    { key: "fecha_nacimiento", label: "Fecha Nacimiento" },
    { key: "domicilio", label: "Domicilio" },
    { key: "localidad", label: "Localidad" },
    { key: "provincia", label: "Provincia" },
    { key: "codigo_postal", label: "Código Postal" },
    { key: "email", label: "Email" },
    { key: "telefono", label: "Teléfono" },
    { key: "profesion", label: "Profesión" },
    { key: "sector", label: "Sector" },
    { key: "rubro", label: "Rubro" },
    { key: "categoria", label: "Categoría" },
    { key: "activo", label: "Activo" },
    { key: "legajo", label: "Legajo" },
    { key: "domicilio_laboral", label: "Domicilio Laboral" },
    { key: "fecha_ingreso", label: "Fecha Ingreso" },
  ];

  const [selectedCols, setSelectedCols] = useState(columns.map(c => c.key));
  const [modalOpen, setModalOpen] = useState(false);

  const handleToggleColumn = (key) => {
    setSelectedCols(selectedCols.includes(key)
      ? selectedCols.filter(k => k !== key)
      : [...selectedCols, key]
    );
  };

  const exportPDF = () => {
    if (!data || data.length === 0) {
      alert("No hay datos para exportar.");
      return;
    }

    const doc = new jsPDF("landscape");

    // --- LOGO EN BASE64 ---
    const logoBase64 = "data:image/png;base64," 
    doc.addImage(logoBase64, "PNG", 10, 10, 20, 20); // x, y, width, height

    // --- NOMBRE ORGANIZACIÓN ---
    doc.setFontSize(16);
    doc.text("SI.TRA.MU.CI - Lista de Afiliados", 50, 25);

    // --- TABLA ---
    const head = [columns.filter(c => selectedCols.includes(c.key)).map(c => c.label)];
    const body = data.map(row =>
      columns
        .filter(c => selectedCols.includes(c.key))
        .map(c => c.key === "activo" ? (row[c.key] ? "Sí" : "No") : row[c.key] || "")
    );

    autoTable(doc, {
      head,
      body,
      styles: { fontSize: 8 },
      headStyles: { fillColor: [41, 128, 185], textColor: 255 },
      startY: 40, // dejar espacio para logo y título
      theme: "grid",
    });

    doc.save("afiliadosSITRAMUCI.pdf");
    setModalOpen(false);
  };

  return (
    <div style={{ marginBottom: "1rem" }}>
      <button onClick={() => setModalOpen(true)} style={{ marginBottom: "0.5rem" }}>
        Exportar PDF
      </button>

      {modalOpen && (
        <Modal onClose={() => setModalOpen(false)}>
          <h3>Seleccionar columnas a exportar</h3>
          <div style={{ maxHeight: "300px", overflowY: "auto", border: "1px solid #ccc", padding: "5px" }}>
            {columns.map(col => (
              <label key={col.key} style={{ display: "block", marginBottom: "4px" }}>
                <input
                  type="checkbox"
                  checked={selectedCols.includes(col.key)}
                  onChange={() => handleToggleColumn(col.key)}
                />{" "}
                {col.label}
              </label>
            ))}
          </div>
          <div style={{ marginTop: "10px" }}>
            <button onClick={exportPDF} style={{ marginRight: "10px" }}>Exportar</button>
            <button onClick={() => setModalOpen(false)}>Cancelar</button>
          </div>
        </Modal>
      )}
    </div>
  );
};

export default ExportPDFButton;
